import React, { Component, Fragment } from "react";
import { Card } from "react-bootstrap/Card";
import Cardgroup from "react-bootstrap/CardGroup";

class Interest extends Component {
  render() {
    return (
      <Fragment>
        <ol className="breadcrumb">
          <li className="breadcrumb-item active text-center">Interest</li>
        </ol>
        <h1 className="text-center mt-4 mb-4">Hobbies</h1>
        <div className="container">
          <div class="row">
            <Cardgroup>
              <Card className="col-sm">
                <Card.Img
                  variant="top"
                  style={{ width: "10rem", display: "flex" }}
                  src="https://img.freepik.com/free-vector/vintage-cricket-elements-collection_1284-37952.jpg?w=150"
                />
                <Card.Body>
                  <Card.Title className="text-center">Cricket</Card.Title>
                  <Card.Text>
                    Playing cricket is love but playing with childhood friends
                    is like a decade cross
                  </Card.Text>
                </Card.Body>
              </Card>

              <Card className="col-sm ">
                <Card.Img
                  variant="top"
                  style={{ width: "18rem" }}
                  src="data:image/jpeg;base64,"
                />
                <Card.Body>
                  <Card.Title className="text-center">Cricket</Card.Title>
                  <Card.Text>
                    Playing cricket is love but playing with childhood friends
                    is like a decade cross.
                  </Card.Text>
                </Card.Body>
              </Card>
              <Card className="col-sm">
                <Card.Img
                  variant="top"
                  style={{ width: "20rem" }}
                  src="data:image/jpeg;base64,"
                />
                <Card.Body>
                  <Card.Title className="text-center">Online Games</Card.Title>
                  <Card.Text>
                    Due to Corona-virus's lockdown we all get attached with
                    Online mobile games.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Cardgroup>
          </div>
        </div>
        <h1 className="text-center">Learned || Learning</h1>
        <div className="container">
          <div class="row">
            <Card className="col-sm" style={{ width: "18rem" }}>
              <Card.Img
                variant="top"
                src="https://img.freepik.com/free-vector/vintage-cricket-elements-collection_1284-37952.jpg?w=150"
              />
              <Card.Body>
                <Card.Title className="text-center">Web Development</Card.Title>
                <Card.Text>
                  Playing cricket is love but playing with childhood friends is
                  like a decade cross
                </Card.Text>
              </Card.Body>
            </Card>
          </div>
        </div>
      </Fragment>
    );
  }
}

export default Interest;
